query:
/*+ NoMergeJoin(mi t) NoNestLoop(mi t mi_idx) */ select count(*)
from movie_info AS mi
inner join title AS t
on t.id = mi.movie_id AND mi.info_type_id > 106 AND t.kind_id < 7 AND t.production_year < 2010
inner join movie_info_idx AS mi_idx
on t.id = mi_idx.movie_id AND mi_idx.info_type_id = 100;
